names, locations, typess, pricess, reviews, ratings, commentss, images = [], [], [], [], [], [], [], []

current, missed = 1, 0

# print(all_links)
# print("")

for hotel_link in all_links:

    # print(hotel_link)

    # Initial code
    # chrome_options = Options()
    # chrome_options.headless = False
    # driver = uc.Chrome(options=chrome_options)

    # Poornesh putty code
    options = webdriver.ChromeOptions()
    options.add_argument("--headless")
    options.add_argument('--disable-dev-shm-usage')
    options.add_argument("--no-sandbox")
    
    driver = webdriver.Chrome(
        options=options
    )

    # # Pooja's code
    # chrome_options = uc.ChromeOptions()
    # chrome_options.add_argument('--headless')
    # chrome_options.headless = True


    driver.get(hotel_link)
    time.sleep(2)

    try:
        response = driver.page_source
    except:
        missed = missed + 1
        driver.quit()
        continue

    # print(response)

    soup = BeautifulSoup(response, 'lxml')

    # dont add a feature immediately after getting
    # coz if the following feature is not able to get it may result in null values
    # so better add only if u r able to get all the features for a hotel
    # and so first try getting each feature & then add altogether finally

    # NAME
    name = soup.find('p', class_='HeaderCerebrum__Name')
    try:
        got_name = name.text
    except:
        missed = missed + 1
        driver.quit()
        continue

    # LOCATION
    location = soup.find('span',
                         class_='Spanstyled__SpanStyled-sc-16tp9kb-0 gwICfd kite-js-Span HeaderCerebrum__Address')
    try:
        got_location = location.text
    except:
        missed = missed + 1
        driver.quit()
        continue

    # ROOM TYPES
    types = soup.find_all('span', class_='MasterRoom__HotelName')

    types_text = []
    if len(types) != 0:
        for i in types:
            types_text.append(i.text)
    else:
        missed = missed + 1
        driver.quit()
        continue

    # ROOM PRICES
    prices = soup.find_all('span',
                           class_="Spanstyled__SpanStyled-sc-16tp9kb-0 gwICfd kite-js-Span pd-price PriceDisplay "
                                  "PriceDisplay--noPointer PriceDisplay pd-color")
    prices_text = []
    if len(prices) != 0:
        for i in prices:
            prices_text.append(i.text)
    else:
        missed = missed + 1
        driver.quit()
        continue

    # REVIEW
    review = soup.find('p', class_="sc-jrAGrp sc-kEjbxe bvAJVt gOeEsn")
    try:
        got_review = review.text
    except:
        missed = missed + 1
        driver.quit()
        continue

    # RATING
    rating = soup.find('p', class_='sc-jrAGrp sc-kEjbxe fzPhrN gOeEsn')
    try:
        got_rating = rating.text
    except:
        missed = missed + 1
        driver.quit()
        continue

    # COMMNETS
    comments = soup.find_all('span', class_="sc-jrAGrp sc-kEjbxe eDlaBj cSoqie")

    comments_text = []
    if len(comments) != 0:
        for i in comments:
            comments_text.append(i.text)
    else:
        missed = missed + 1
        driver.quit()
        continue

    # IMAGES
    image1 = soup.find('img', class_='SquareImage')
    try:
        image1_link = 'https:' + image1['src']
    except:
        missed = missed + 1
        driver.quit()
        image1_link = None

    # WRITING TO CSV FILE
    # with open('new.csv', 'a',newline='',encoding='utf-8') as file:
    #     writer = csv.writer(file)
    #     writer.writerow([got_name,got_location,types_text,prices_text,got_review,got_rating,comments_text,image1_link])

    # MAINTAIN THE RETRIVED FEATURES AS LISTS
    names.append(got_name)
    locations.append(got_location)
    typess.append(types_text)
    pricess.append(prices_text)
    reviews.append(got_review)
    ratings.append(got_rating)
    commentss.append(comments_text)
    images.append(image1_link)

    # CLOSE THE BROWSER AND TERMINATE THE WEB DRIVER
    driver.quit()

    print("hotel " + str(current) + " completed")
    current = current + 1

print("")

